import React from 'react';

function RightSidebar({ frameworks, onFrameworkClick }) {
  return (
    <div className="right-sidebar">
      <h3>Frameworks</h3>
      <ul>
        {frameworks.map((framework) => (
          <li key={framework.name}>
            <button onClick={() => onFrameworkClick(framework)}>
              {framework.name}
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default RightSidebar;
